import React from "react";
import { LoginContainer, LoginContent, LoginH1, ButtonContainer, ButtonContainerR, Button } from "./SpotifyLoginElements"
import { ReactComponent as Login } from "../../images/LoginButton.svg";
// import { ReactComponent as Spotify } from "../../images/SpotifyIcon.svg";
import { ReactComponent as Back } from "../../images/BackArrow.svg";
import { Link } from 'react-router-dom';

const SpotifyLogin = () => {
    const [currentTime, setCurrentTime] = useState(0);

    useEffect(() => {
        fetch('/time').then(res => res.json()).then(data => {
        setCurrentTime(data.time);
        });
    }, []);

    return(
        <LoginContainer>
            <LoginContent>
                <LoginH1>
                    To get started, we'll need to see your Spotify.
                    <br /><br />
                    Weâ€™re just gonna look at what you listen to. 
                    We won't post or change anything.
                </LoginH1>
                <ButtonContainerR>
                    {/* Change this Link, user needs to login to Spotify here */}
                    <Link to="/permission" padding="0px 0px">
                    <Button>
                        <Login className="Log in with Spotify" />
                    </Button>
                    </Link>
                </ButtonContainerR>
                <br /><br /><br /><br /><br /><br /><br />
                <ButtonContainer>
                    <Link to="/" padding="0px 0px">
                    <Button>
                        <Back className="backButton" />
                    </Button>
                    </Link>
                </ButtonContainer>
            </LoginContent>
        </LoginContainer>
    );
};


export default SpotifyLogin;
